import React from 'react';
import './Ladder.css';
import ladderData from './2019_1_OMM2_ladder.json';


const ladder = (props) => {

    let teams = ladderData.teams;

    teams.map(team =>  {
        <LadderRung
        position= {team.position}
        teamName= {team.teamName}
        points= {team.points}
        />
    });

    return (
        <div className="slide" id="ladderSlide">
            <h3>Ladder</h3>

        </div>
    )
}

export default ladder;
